import "./posts.css";
import Post from "../post/post"
import { Link } from "react-router-dom"

export default function posts() {
  return (
    <div className="posts">
   <Link className="link" to="/register"><Post/></Link>
    <Post/>
    <Post/>
    <Post/>
    <Post/>
    <Post/>
      
    </div>
  )
}
